export default function Contact(props){
    let contact=props.content;
    return (
        <>
            <div className="h-64 relative bgImageClass">
                {/* <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRGKAz6E-baMEjSVcFsdvunAhgPjclQcZNCeQ&s" className="w-full h-full"></img> */}
